import React from 'react';

const Menu = ({ selectedCategory, addToCart }) => {
  const items = [
    { id: 1, name: 'Go\'shtli somsa', price: 7000 },
    { id: 2, name: 'Kartoshkali somsa', price: 7000 },
  ];

  return (
    <div>
      <h3>Menu - {selectedCategory}</h3>
      {items.map(item => (
        <div key={item.id}>
          <p>{item.name} - {item.price} so'm</p>
          <button onClick={() => addToCart(item, 1)}>Add to Cart</button>
        </div>
      ))}
    </div>
  );
};

export default Menu;
